import React from "react";
import acm from "./images/acm.jfif";
import Card from "./Card";
function Clubs() {
  return (
    <div className="container">
        <h1 className="text-center a">SVNIT's Student Chapters</h1>
      <div class="row">
        <div class="col-lg-4">
          <Card />
        </div>
      </div>
    </div>
  );
}
export default Clubs;
